import React from 'react'
import Card from './Card.js'

const CardList = ({robots}) => {
	return (
		<div>
	      <Card roboid={robots[0].id} robo_name={robots[0].name} roboemail={robots[0].email}/>
	      <Card roboid={robots[1].id} robo_name={robots[1].name} roboemail={robots[1].email}/>
	    </div>

	);
}

export default CardList;
